from collections import Counter
from math import gcd
from functools import reduce

def has_subpattern(s):
    c,m=Counter(s),1e9
    a=list(c.values())
    n=len(a)
    for i in range(n):
        for j in range(i,n):
            m=min(m,gcd(a[i],a[j]))
    return ''.join(sorted(i[0]*(i[1]//m) for i in c.items())) if reduce(gcd,c.values())!=1 else ''.join(sorted(s))

print(has_subpattern(''))
print(has_subpattern(''))